    <style type="text/css">

        * {
            overflow: visible !important; // forces a built-in PDF rendering gotcha in WebKit so that images never span 2 pages
        }
        img {
            margin-top:20px;
            max-width: 92%; // images will never overflow off the right hand side of a page
        }
        .page-break {
            display: block;
            page-break-before: always; // force a page break
        }

        html,body,div,span,applet,object,iframe,h1,h2,h3,h4,h5,h6,p,blockquote,pre,a,abbr,acronym,address,big,cite,code,del,dfn,em,img,ins,
        kbd,q,s,samp,small,strike,strong,sub,sup,tt,var,dl,dt,dd,ol,ul,li,fieldset,form,label,legend,table,caption,tbody,tfoot,thead,tr,th,td {
            margin: 0;padding: 0;border: 0;outline: 0;font-weight: inherit;font-style: inherit;
            font-family: inherit;font-size: 100%;vertical-align: baseline; box-sizing: border-box;}
        body {color: #000;background: #fff;}
        3ol, ul {list-style: none;}
        table {border-collapse: separate;  border-spacing: 0;  vertical-align: middle;}
        caption, th, td {text-align: left;  font-weight: normal;  vertical-align: middle;}
        a img {border: none;}

        html {
            /* For wkhtmltopdf */
            /*zoom: 1.25;*/
        }

        html > body {
            font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif;
            font-size: 14px;
            /* For wkhtmltopdf */
            text-rendering: optimizeLegibility !important;
            /* width: 200px; */
            line-height: 26px;
            letter-spacing: 0.3px;
        }

        ol, ul {
            margin-left: 20px;
        }

        ol > li {
            list-style: decimal outside none;
        }

        ul > li {
            list-style: bullet outside none;
        }

        .bs-mathjax,
        .variable-container,
        .figure-box  {
            border-radius: 5px;
            margin: 0;
            border: 0;
            padding: 0;
            display: inline-block;
            background: transparent;
            line-height: inherit;
            font-size: inherit;
            font-family: inherit;
            outline: 0;
        }

        .figure-box .variable-container,
        .figure-box .mathjax-render-zone {
            display: inline;
            position: static;
        }

        foreignObject,
        .lab,
        .optimization-label {
            font-size: 14px;
        }

        .figure-box {
            display: block;
            margin: 10px auto;
        }
        .figure-box img {
            width: 100%;
        }
        .bs-mathjax {
            margin-top: 5px;
            margin-bottom: 5px;
        }

        .paper-header-items ul,
        .assignment-collection > li,
        p {
            list-style: none;
            margin: 0;
            padding: 0;
        }

        .clearfix:after {
            content: "";
            display: block;
            clear: both;
        }

        .paper-dimension {
            /*min-height: 9.5in;*/
            min-height: 8.5in;
            /*width: 6.9in;*/
            word-wrap: break-word;
        }

        .paper-header-title {
            font-size: 28px;
        }

        .paper-header-logo {
            margin: 0;
            display: block;
            height: 80px;
            margin-bottom: 20px;
        }

        .paper-header-logo > img {
            height: 100%;
        }

        .paper-header-items li {
            margin-bottom: 10px;
            font-weight: bold;
        }

        .question-prefix {
            /*margin-right: 10px;*/
            width: 70px;
            float: left;
            font-weight: 700;
        }

        .paper-header {
            margin-bottom: 20px;
            position: relative;
        }

        .paper-extra-info {
        }

        .paper-disclaimer {
            padding: 10px 25px;
        }

        .paper-header:after, .paper-student-item:after, .paper-extra-info:before {
            display: block;
            content: "";
            position: absolute;
            left: 0;
            right: 0;
            height: 1px;
            background-color: #999;
        }

        .rightAsst {
            float: right;
            width: 280px;
        }

        .leftAsst {
            float: left;
            width: 430px;
        }

        .paper-student-item {
            position: relative;
        }

        .assignment-collection > li {
            padding: 15px;
        }

    </style>
